              <h1>{item.department}</h1>
              <h1>{item.bio}</h1>
              <h1>{item.join_date}</h1>
              <h1>{item.scholar_id_link}</h1>
              <h1>{item.slug}</h1>
              <h1>{item.irns_link}</h1>
              <h1>{item.image}</h1>
              <h1>{item.user}</h1>  
    </div>
      })}
  </div>
}
export default Testing
